interface i1155{

    struct NFTEA {
        uint256 nftea;
        address[] addresses;
        uint256[] settings;
    }
    function fire(address caller_) external pure returns(uint256[] memory,uint256[] memory,uint256,bool,bool,uint256);
    function gflame(string memory flame_) external pure returns(address);
    function getnftea(uint256 nftea_) external pure returns(NFTEA memory,string[] memory, string memory);
    function getlabel(uint256 nftea_, string memory label_) external pure returns(NFTEA memory, uint256[] memory, string memory,bool);
    function getoperator(address operator_, uint256 license_) external pure returns(uint256[4] memory,uint256[] memory,uint256,uint256,uint256,uint256,address);
    function gspark(string memory spark_) external pure returns(uint256);
    function getoperatorrole(uint256 opid_) external pure returns(uint256);
    function gtag(string memory tag_) external pure returns(bool);
    function getipfs(string memory _ipfs) external pure returns(uint256);
    function setedit(uint256 nftea_, string memory ipfs_) external returns(bool);
    function getfee(string memory fee_) external pure returns(uint256);
    function mint(uint256 assetid_, string memory ipfs_, address sendto_, uint256[] memory settings_, string memory label_) external returns(uint256);
    function createwallet(address[] memory addresses_, uint256 nftea_, uint256 label_) external returns(address);
    function settransferable(uint256 nftea_, uint256 value_, address wallet) external returns(bool);
    function setmint(uint256 nftea_,address[] memory addresses_,uint256[] memory settings_,string memory label_) external returns(bool);
    function setmediaattribute(uint256 nftea_, string memory media_, string memory title_) external returns(bool);
    function tokenURI(uint256 nftea_) external pure returns(string memory);
    function mintContract(string memory label_, string memory symbol_, string memory ipfs_) external returns(address);
    function setGasRefund(address holder_, uint256 gas_) external returns(bool);
    function _label2nftea(string memory label_) external pure returns(uint256);
    function setrenew(uint256 nft_, uint256 expire) external returns(bool);
    function getnftea2label(uint256 nftea_) external pure returns(uint256,uint256);
    function unWrap(uint256 nftea_, address contract_) external returns(bool);

}
contract mintlogic {

    using SafeMath for uint256;


    string public name = "MINT LOGIC V1";
    address public _burn = 0x000000000000000000000000000000000000dEaD;
    address public _fire;
    bytes4 private constant INTERFACE_ID_ERC721 = 0x80ac58cd;
    bytes4 private constant INTERFACE_ID_ERC1155 = 0xd9b67a26;
    mapping(uint256=>string) public _nftea2ipfs;
    mapping(uint256=>address[]) public _nftea2addresses;
    mapping(uint256=>uint256[]) public _nftea2settings;
    mapping(uint256=>uint256) private _nftea2wrapto;
    i1155.NFTEA _nfteas;

    constructor(address fire_){
        _fire = fire_;
    }
    receive () external payable {}
    function onERC1155Received(
        address,
        address,
        uint256,
        uint256,
        bytes memory
    ) public virtual returns (bytes4) {
        return this.onERC1155Received.selector;
    }
    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    ) public virtual returns (bytes4) {
        return this.onERC721Received.selector;
    }
    //nftea types
    //1. label
    //2. label - profile
    //3. label - Tags
    //4. label - chapters
    //5. license - label operator
    //6. license - label marketplace
    //7. mint pass
    //8. nftea
    //9. generative nftea
    //10. redeemable nftea
    //11. wrap to nftea
    function gettag(string memory label_) internal pure returns (string memory){
        bytes memory a = new bytes(1);
        a[0] = bytes(label_)[0];
        return string(a);
    }
    function expirecheck(uint256 label_) internal view returns(bool){
      (address flame_) = i1155(_fire).gflame('mintstorage');
      (, uint256 expire_) = i1155(flame_).getnftea2label(label_);
      require(block.timestamp<expire_ || expire_ == 0, 'label expired');
      return true;
    }
    function checkLabel(string memory label_) internal returns(bool, bool, uint256){

      bool burned = false;
      bool expired = false;
      (address flame_) = i1155(_fire).gflame('mintstorage');
      (uint256 nft_) = i1155(flame_)._label2nftea(label_);
      if(nft_>0){
        (_nfteas,,) = i1155(flame_).getnftea(nft_);
        //grace period
        uint256 grace = _nfteas.settings[7] + 7 days;
        if(block.timestamp > grace){
          expired = true;
        }
        //check of label has been burned
        (flame_) = i1155(_fire).gflame('mintcontract');
        IERC1155 nft = IERC1155(flame_);
        if(nft.balanceOf(_burn, nft_)==_nfteas.settings[6]){
          burned = true;
        }
      }
      return(burned,expired,nft_);
    }
    function renew(uint256 expire_, string memory label_) public{

      (address flame_) = i1155(_fire).gflame('mintstorage');
      (uint256 nft_) = i1155(flame_)._label2nftea(label_);
      (uint256 price_) = i1155(_fire).getfee('label');
      if(price_>0){

          price_ = price_.mul(expire_);
          (address paytoken_) =i1155(_fire).gflame("teatoken");
          (address marketing_) =i1155(_fire).gflame("marketing");
          IERC20(paytoken_).transferFrom(msg.sender,marketing_,price_);
          require(checkSuccess(), 'error paying to renew label');

      }
      (bool success)= i1155(flame_).setrenew(nft_,expire_);
      require(success, 'error renewing label');
    }

    function mintstart(string[] memory strings_, uint256[] memory settings_, address[] memory addresses_) public returns (uint256, address) {
      uint256 startGas = gasleft();

      uint256 nftea_;
      address wallet_;
      bool newmint_ = false;
      bool success = false;
      bool burned_ = false;
      (address flame_) = i1155(_fire).gflame('mintstorage');
      if (settings_[3] > 0 && settings_[3] < 7) {
        (bool burned, bool expired, uint256 nft_) = checkLabel(strings_[0]);
        burned_ = burned;
        if (burned || nft_ < 1 || expired) {
          // mint new label
          newmint_ = true;
        }
      } else {
        if (settings_[0] > 0) {
          (flame_) = i1155(_fire).gflame('mintcontract');
          IERC1155 nft = IERC1155(flame_);
          if (nft.balanceOf(_burn, settings_[0]) == 1) {
            burned_ = true;
          }
          (success) = expirecheck(settings_[0]);
          require(success, 'label expired');
        }
        newmint_ = true;
      }
      if (newmint_) {
        (nftea_, wallet_) = mint(strings_, settings_, addresses_, burned_);
      }
      uint256 endGas = gasleft();
      uint256 gasUsed = startGas - endGas;

      // Calculate the gas refund based on the actual gas used
      uint256 refundAmount = gasUsed * tx.gasprice;

      // Transfer the gas refund to the sender
      (flame_) = i1155(_fire).gflame('teapot');
      (success) = i1155(flame_).setGasRefund(msg.sender, refundAmount);
      require(success, 'error transferring gas refund');

      return (nftea_, wallet_);
    }
    function mint(string[] memory strings_, uint256[] memory settings_, address[] memory addresses_, bool burned_) internal returns(uint256, address){
        require(settings_[6]>0, 'mint at least 1');
        require(addresses_[1]!=address(0), 'invalid minter address');
        address flame_ = address(0);
        address wallet_ = address(0);
        bool success = false;

        if(settings_[9]==0 && settings_[3]==3){
            //not transferable, check if tag is valid
            string memory tag_ = gettag(strings_[2]);
            (success) = i1155(_fire).gtag(tag_);
            require(success, tag_);
        }
        if(settings_[0]>0 && settings_[12]<1){

            // linked to a label, must validate minter
            (flame_) = i1155(_fire).gflame('operatorstorage');
            //validate operator
            (,,uint256 opid_, uint256 expirex_,uint256 oplabel_,,address walletlabel_) = i1155(flame_).getoperator(msg.sender,settings_[0]);
            require(opid_>0, 'invalid operator');
            require(expirex_ > block.timestamp || expirex_==0, 'operator license expired');
            (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
            require(rolex_==1, 'you are not a super oerpertor');
            require(!burned_, 'label burned');
            //check if label for operator expired
            (success) = expirecheck(oplabel_);
            require(success, 'operator label expired');
            //minter okay
            addresses_[3] = walletlabel_;
        }
         (flame_) = i1155(_fire).gflame('mintcontract');
         (uint256 nftea_) = i1155(flame_).mint(0,strings_[1], addresses_[1],settings_,strings_[0]);
         require(nftea_>0, 'error minting');
         if(settings_[6]==1){
             uint256 labelnftea_ = settings_[0];
             if(labelnftea_==0){
                 labelnftea_ = nftea_;
             }
             (flame_) = i1155(_fire).gflame('baglogic');
             (wallet_) = i1155(flame_).createwallet(addresses_,nftea_,labelnftea_);
             require(wallet_!=address(0), 'error setting wallet');
             addresses_[2] = wallet_;
         }
         if(settings_[3]==2){
             //set label owner
            addresses_[3] = msg.sender;
         }
        (success) = mintcomplete(nftea_,addresses_,settings_,strings_[0]);
         require(success,'error completing mint');
         return (nftea_, wallet_);
    }
    function mintcomplete(uint256 nftea_,address[] memory addresses_, uint256[] memory settings_, string memory label_) internal returns(bool){

        (address flame_) = i1155(_fire).gflame('mintcontract');
        if(addresses_[4]==flame_){
          (flame_) = i1155(_fire).gflame('mintstorage');
          (_nfteas,,) = i1155(flame_).getnftea(settings_[10]);
          addresses_[0] = _nfteas.addresses[0];
          addresses_[3] = address(0);
        }
        (flame_) = i1155(_fire).gflame('mintstorage');
        (bool success) = i1155(flame_).setmint(nftea_,addresses_,settings_,label_);
        require(success, 'error');
        (flame_) = i1155(_fire).gflame('mintcontract');
        (success) = i1155(flame_).settransferable(nftea_,settings_[9],addresses_[2]);
        require(success, 'error setting transfer permissions');
        if(settings_[3]>=1 && settings_[3]<7){
            ///pay to mint this label
            //get label price
            (uint256 price_) = i1155(_fire).getfee('label');
            if(price_>0){

                price_ = price_.mul(settings_[1]);
                (address paytoken_) =i1155(_fire).gflame("teatoken");
                (address marketing_) =i1155(_fire).gflame("marketing");
                IERC20(paytoken_).transferFrom(msg.sender,marketing_,price_);
                require(checkSuccess(), 'error paying for label');

            }
        }
        return true;
    }
    function wrap(address contract_, uint256 nft_, uint256[] memory settings_, address[] memory addresses_, string memory ipfs_) public returns(bool){
        uint256 startGas = gasleft();
        string memory label_;
        (address flame_) = i1155(_fire).gflame('wrapbridge');
        if(msg.sender!=flame_){
          if (IERC165(contract_).supportsInterface(INTERFACE_ID_ERC721)) {

              IERC721 nft = IERC721(contract_);
              require(nft.ownerOf(nft_) == msg.sender || nft.ownerOf(nft_)==_burn, "nft not yours");
              if(nft.ownerOf(nft_) == msg.sender){
                  nft.safeTransferFrom(msg.sender, address(this), nft_);
                  require(checkSuccess(), 'error wrap transfer');
              }
              ipfs_ = getURI(contract_,nft_);

          } else if (IERC165(contract_).supportsInterface(INTERFACE_ID_ERC1155)) {

              IERC1155 nft = IERC1155(contract_);
              require(nft.balanceOf(msg.sender, nft_) > 0 || nft.balanceOf(_burn, nft_) ==1, "not your nft");
              if(nft.balanceOf(msg.sender, nft_) > 0){
                  nft.safeTransferFrom(msg.sender, address(this), nft_, 1, '');
                  require(checkSuccess(), 'error wrap transfer 1155');
              }
              ipfs_ = getURI(contract_,nft_);
          }
        }

        settings_[6] = 1;
        settings_[3] = 11;
        (flame_) = i1155(_fire).gflame('mintstorage');
        if(settings_[0]>0){
          (,,label_,) = i1155(flame_).getlabel(settings_[0],'open');
        }else{
          label_ = '-open-';
        }
        string[] memory strings_ = new string[](3);
          strings_[0] = label_;
          strings_[1] = ipfs_;
          strings_[2] = "n/a";
        (flame_) = i1155(_fire).gflame('mintcontract');
        (uint256 nftea_) = i1155(flame_).mint(0,strings_[1], addresses_[1],settings_,strings_[0]);
        require(nftea_>0, 'error minting');
        (flame_) = i1155(_fire).gflame('baglogic');
        (address wallet_) = i1155(flame_).createwallet(addresses_,nftea_,0);
        require(wallet_!=address(0), 'error setting wallet');
        addresses_[2] = wallet_;
        addresses_[3] = address(0);
        (bool success) = mintcomplete(nftea_,addresses_,settings_,strings_[0]);
        require(success, 'error completing wrap');
        uint256 endGas = gasleft();
        uint256 gasUsed = startGas - endGas;
        uint256 refundAmount = gasUsed * tx.gasprice;

        (flame_) = i1155(_fire).gflame('teapot');
        (success) = i1155(flame_).setGasRefund(msg.sender,refundAmount);
        require(success, 'error settng gas refund');
        _nftea2wrapto[nftea_] = nft_;
        return (success);
    }
    function unWrap(uint256 nft_) public{
      uint256 startGas = gasleft();

        (address flame_) = i1155(_fire).gflame('mintcontract');
        require(IERC1155(flame_).balanceOf(msg.sender,nft_)>0, 'you do not own this nft');
        IERC1155(flame_).safeTransferFrom(msg.sender, _burn, nft_, 1, '');

        (flame_) = i1155(_fire).gflame('mintstorage');
        (_nfteas,,) = i1155(flame_).getnftea(nft_);
        if (IERC165(_nfteas.addresses[4]).supportsInterface(INTERFACE_ID_ERC721)) {

            IERC721(_nfteas.addresses[4]).safeTransferFrom(address(this), msg.sender, _nftea2wrapto[nft_],'');
            require(checkSuccess(), 'error unwrappinig');

        } else if (IERC165(_nfteas.addresses[4]).supportsInterface(INTERFACE_ID_ERC1155)) {

            IERC1155(_nfteas.addresses[4]).safeTransferFrom(address(this), msg.sender, 1, _nftea2wrapto[nft_],'');
            require(checkSuccess(), 'error wrappinig');
        }
        (flame_) = i1155(_fire).gflame('mintstorage');
        (bool success) = i1155(flame_).unWrap(nft_,_nfteas.addresses[4]);
        require(success, 'error unwrapping');
        uint256 endGas = gasleft();
        uint256 gasUsed = startGas - endGas;
        uint256 refundAmount = gasUsed * tx.gasprice;
        (flame_) = i1155(_fire).gflame('teapot');
        (success) = i1155(flame_).setGasRefund(msg.sender,refundAmount);
        require(success, 'error refunding gas');

    }
    function getURI(address contract_, uint256 nft_) public pure returns (string memory) {

        return (i1155(contract_).tokenURI(nft_));
    }

    function setmediaattribute(uint256 nftea_, string memory media_, string memory title_, uint256[] memory nfteas_, string[] memory medias_, string[] memory titles_) public {

        ///must be creator or operator of nftea not minter
        if(nfteas_.length>0){

            for (uint256 i = 0; i < nfteas_.length; ++i) {

                (address flame_) = i1155(_fire).gflame('mintstorage');
                (_nfteas,,) = i1155(flame_).getnftea(nfteas_[i]);
                if(_nfteas.settings[0]>0){
                    ///linked to label... validate operator
                    (flame_) = i1155(_fire).gflame('operatorstorage');
                    //validate operator
                    (,,uint256 opid_, uint256 expirex_,,,) = i1155(flame_).getoperator(msg.sender,_nfteas.settings[0]);
                    require(opid_>0, 'invalid operator');
                    require(expirex_ > block.timestamp || expirex_==0, 'operator license expired');
                    (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
                    if(rolex_==1){
                        i1155(flame_).setmediaattribute(nfteas_[i], medias_[i], titles_[i]);
                    }
                }else{
                    i1155(flame_).setmediaattribute(nfteas_[i], medias_[i], titles_[i]);
                }
            }

        }else{

            (address flame_) = i1155(_fire).gflame('mintstorage');
            (_nfteas,,) = i1155(flame_).getnftea(nftea_);
            if(_nfteas.settings[0]>0){
                ///linked to label... validate operator
                (flame_) = i1155(_fire).gflame('operatorstorage');
                //validate operator
                (,,uint256 opid_, uint256 expirex_,,,) = i1155(flame_).getoperator(msg.sender,_nfteas.settings[0]);
                require(opid_>0, 'invalid operator');
                require(expirex_ > block.timestamp || expirex_==0, 'operator license expired');
                (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
                require(rolex_==1, 'you are not a super oerpertor');

            }else{

                require(_nfteas.addresses[0]==msg.sender, 'only creator can add media attributes');

            }
            (bool success ) = i1155(flame_).setmediaattribute(nftea_, media_, title_);
            require(success, 'error setting attribute');
        }

    }
    function edit(uint256 nftea_, string memory ipfs_) public {

        (address flame_) = i1155(_fire).gflame('mintstorage');
        (_nfteas,,) = i1155(flame_).getnftea(nftea_);
        (flame_) = i1155(_fire).gflame('mintcontract');
        uint256 balance_ = IERC1155(flame_).balanceOf(msg.sender,nftea_);
        require(balance_==_nfteas.settings[6], 'must own all nfteas to edit');

        if(_nfteas.settings[0]>0){
            ///linked to label... validate operator
            (flame_) = i1155(_fire).gflame('operatorstorage');
            //validate operator
            (,,uint256 opid_, uint256 expirex_,,,) = i1155(flame_).getoperator(msg.sender,_nfteas.settings[0]);
            require(opid_>0, 'invalid operator');
            require(expirex_ > block.timestamp || expirex_==0, 'operator license expired');
            (uint256 rolex_)= i1155(flame_).getoperatorrole(opid_);
            require(rolex_==1, 'you are not a super oerpertor');
        }

        (flame_) = i1155(_fire).gflame('mintcontract');
        (bool success) = i1155(flame_).setedit(nftea_, ipfs_);
        require(success, 'error editing');
    }
    function checkSuccess()
    private pure
    returns (bool)
    {
        uint256 returnValue = 0;

        /* solium-disable-next-line security/no-inline-assembly */
        assembly {
        // check number of bytes returned from last function call
            switch returndatasize()

            // no bytes returned: assume success
            case 0x0 {
                returnValue := 1
            }

            // 32 bytes returned: check if non-zero
            case 0x20 {
            // copy 32 bytes into scratch space
                returndatacopy(0x0, 0x0, 0x20)

            // load those bytes into returnValue
                returnValue := mload(0x0)
            }

